  `phoneNumber` VARCHAR(13) NOT NULL,
  `address` VARCHAR(200) NOT NULL,
  PRIMARY KEY (`customerID`))
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `ZQRT`.`warehouse`
-- -----------------------------------------------------
